//SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

contract EVS{
    //Structure for the candidate's information
    struct Candidate {
        uint256 id;
        string name;
        uint256 numVotes; //candidate's number of votes
    }
    
    Candidate[] public candidates; //list of candidates

    address public admin; //address of the voting organizer

    //To track all voters 
    mapping (address => bool) public voters;
    //list of voters
    address[] public voterList;

    //Voting Sessions
    uint256 public vStart; //session start
    uint256 public vEnd; //session end

    // status of the election
    bool public electionStarted;

    //admin privileges
    modifier onlyAdmin() {
        require(msg.sender == admin,"Error: You do not have admin privileges.");
        _;
    }

    //if election is ongoing
    modifier OnGoing() {
        require(electionStarted,"Election has not started.");
        _;
    }
    //deployer will be owner of the contract, only admin can deploy the contract hence, admin is owner
    constructor(){
        admin = msg.sender;
    }

    //start election function
    function startElection(string[] memory _candidates, uint256 _votingLength)public onlyAdmin{
        require(electionStarted == false, "Election is currently ongoing.");
        delete candidates;
        resetVoterStatus();

        for(uint256 i = 0; i < _candidates.length; i++){
            candidates.push(
                Candidate({id: i,name:_candidates[i],numVotes:0})
            );
        }
        electionStarted = true;
        vStart = block.timestamp;
        vEnd = block.timestamp + (_votingLength * 1 minutes);
    }

    //add candidate function
    function createCandidate(string memory _name)public onlyAdmin {
        require(checkElectionPeriod(), "Election Period has ended.");
        candidates.push(
            Candidate({id: candidates.length,name: _name, numVotes:0})
        );
    }
    
    //if voters has voted or not
    function voterStatus(address _voter)public view OnGoing returns(bool){
        if(voters[_voter] == true){
            return true;
        }
        return false;
    }
    //vote function
    function voteTo(uint256 _id)public OnGoing {
        require(checkElectionPeriod(),"Election Period has ended.");
        require(!voterStatus(msg.sender),"You can only vote once.");
        candidates[_id].numVotes++;
        voters[msg.sender] = true;
        voterList.push(msg.sender);
    }
    //get num of votes
    function getVotes() public view returns(Candidate[] memory){
        return candidates;
    }

    //monitor election time function
    function ETimer() public view OnGoing returns(uint256){
        if(block.timestamp >= vEnd){
            return 0;
        }
        return (vEnd - block.timestamp);
    }

    //check if election is still ongoing
    function checkElectionPeriod() public returns(bool) {
        if(ETimer() > 0){
            return true;
        }
        electionStarted = false;
        return false;
    }
    
    //reset voter status for new election
    function resetVoterStatus() public onlyAdmin{
        for (uint256 i = 0; i < voterList.length; i++){
            voters[voterList[i]] = false;
        }
        delete voterList;
    }
}

